SELECT
  (
    SUBTIME('2017-04-06 10:50:38', '03:25:31') >> "f4" # BIN("f6")
  ) AS "f1",
  (
    ACOS(0.4622292496282677)
  ) AS "f2",
  (
    -UNIX_TIMESTAMP('2002-09-25 00:32:59') - INTERVAL '1 MINUTE'
  ) AS "f3"
FROM (
  SELECT
    "col_bigint_undef_unsigned" AS "f4",
    "col_double_undef_unsigned" AS "f5",
    "col_decimal(40, 20)_undef_signed" AS "f6"
  FROM "table_3_utf8_undef"
) AS "t1"
WHERE
  (
    (
      (
        (
          NOT "f6"
        ) <> (
          HOUR('16:04:44')
        )
      ) IS FALSE
    )
    OR (
      (
        CAST((
          "f6"
        ) AS CHAR) LIKE '%1%'
      ) IS FALSE
    )
    AND (
      (
        NOT "f5"
      ) IS TRUE
    )
  ) IS FALSE
HAVING
  (
    "f1" * NOT ADDDATE('2005-01-01', INTERVAL '1 YEAR')
  ) <= (
    FROM_DAYS(5674645584111350192)
  );

SELECT
  (
    "f4"
  ) AS "f1",
  (
    CAST(FORMAT_BYTES("f4") AS BYTEA)
  ) AS "f2",
  (
    -0
  ) AS "f3"
FROM (
  SELECT
    (
      "f8" - INTERVAL '1 HOUR'
    ) AS "f4",
    (
      "f8"
    ) AS "f7",
    (
      "f10"
    ) AS "f6"
  FROM (
    SELECT
      "col_double_key_unsigned" AS "f8",
      "col_float_key_unsigned" AS "f9",
      "col_double_key_unsigned" AS "f10"
    FROM "table_7_utf8_undef"
  ) AS "t1"
  WHERE
    (
      (
        (
          EXISTS(
            SELECT
              "col_bigint_undef_unsigned"
            FROM "table_3_utf8_undef"
          )
        ) IS FALSE
      )
      AND (
        (
          NOT CAST((
            1
          ) AS CHAR) LIKE '%0%'
        ) IS TRUE
      )
    ) IS FALSE
) AS "t2"
STRAIGHT_JOIN (
  SELECT
    "col_double_undef_signed" AS "f11",
    "col_bigint_key_signed" AS "f5",
    "col_float_key_signed" AS "f12"
  FROM "table_3_utf8_undef"
) AS "t3";

SELECT
  (
    NOT "f4"
  ) AS "f1",
  (
    COLLATION("f6") + INTERVAL '1 DAY_SECOND'
  ) AS "f2",
  (
    ADDTIME('2001-11-13 00:30:22', '00:17:53') << "f6"
  ) AS "f3"
FROM (
  SELECT
    "col_decimal(40, 20)_key_signed" AS "f4",
    "col_float_key_unsigned" AS "f5",
    "col_double_key_unsigned" AS "f6"
  FROM "table_7_utf8_undef"
) AS "t1"
HAVING
  (
    (
      NOT (
        (
          ~'something'
        ) IN (
          SELECT
            "col_char(20)_key_signed"
          FROM "table_7_utf8_undef"
        )
      )
    )
    AND (
      (
        NOT (
          LEFT("f1", 0)
        ) BETWEEN 0 AND FIELD("f1", "f3", 'u', 0.8238737850979871)
      ) IS FALSE
    )
  ) IS TRUE;

SELECT
  (
    -"f4" + INTERVAL '1 MICROSECOND'
  ) AS "f1",
  (
    CAST(COLLATION('2004') AS BYTEA)
  ) AS "f2",
  (
    SUBTIME('2014-07-13 20:05:16', '06:18:06') # "f6" # "f6"
  ) AS "f3"
FROM (
  SELECT
    "col_double_key_unsigned" AS "f4",
    "col_varchar(20)_key_signed" AS "f5",
    "col_double_undef_signed" AS "f6"
  FROM "table_7_utf8_undef"
) AS "t1"
HAVING
  (
    (
      EXISTS(
        SELECT
          "col_bigint_key_unsigned"
        FROM "table_3_utf8_undef"
      )
    )
    OR (
      (
        COLLATION("f3") % 'didn''t'
      ) IS FALSE
    )
    AND (
      NOT (
        NOT (
          "f3"
        ) IN ("f3", WEEKDAY('2013-10-14 02:04:49'), "f1")
      )
    )
  ) IS TRUE;
